import React from 'react';
import tableContext from './tableContext';
const Td = (props) => {
	const {id, name, avatar} = props.children;
	return (
		<tableContext.Consumer>
			<td className={props.theme}>
				<img style={{width: '60px', height: '60px'}} src={avatar} alt="" />
			</td>
			<td className={props.theme}>{name}</td>
			<td className={props.theme}>{id}</td>
		</tableContext.Consumer>
	);
};

export default Td;
